import React, { useState } from 'react';
import './App.css';

function SearchField() {
  const [query, setQuery] = useState('stars:>100')
  return (
    <div>
      <p>Searching for: {query}</p>
    </div>
  );
}

function App() {
  fetch('https://api.github.com/search/repositories?q=stars:>100&sort=stars&order=desc&per_page=2&page=1')
  .then((response) => {
    return response.json();
  })
  .then((data) => {
    console.log(data);
